Planning Permisson sought for the works 106 Kimmage Road Lower, Dublin 6w D6W ER82, an existing two-storey four-bedroom semi-detached single dwelling
(i) Demolition of an existing single storey shed to the rear & partial demolition of the existing two-storey return to the rear of the existing house;
(ii) the construction of a new two storey extension to the rear of the existing house to accommodate a new kitchen / living / dining room & WC to the ground floor & two new bedrooms & a bathroom to the first floor, the new extension is to be part-flat roofed at both ground & first floor levels and is to retain the existing sloped roof of the return to the rear of the house, a new flat roof roof light is proposed to be provided above the ground floor part of the new extension to the rear;
(iii) the conversion of the existing attic space into habitable accommodation to provide a new ensuite bedroom with a new dormer structure to be provided to the rear slope of the main roof, the total number of bedrooms to the extended house to be increased to six;
(iv) the provision of a second smaller dormer structure to the rear slope of the main roof to provide headroom over a new internal stairs up to the new attic bedroom ;
(v) the provision of a new velux-type roof light to the rear slope of the main roof over the new stairs;
(vi) the provision of a new velux-type roof light to the front slope of the main roof over the proposed new attic Ensuite;
(vii) the provision of a solar panel array to the west facing slope of the existing roof over the return to the rear of the house;
(viii) widening two existing window opes to the rear wall of the main part of the house, one at ground floor level & one at first floor level;
(ix)the provision of one new off-street car-parking space to the front of the house, accessed from Kimmage Road Lower, and the provision of new vehicular entrance gates and retaining walls & railings within the site to facilitate this;
(x) the provision of external insulation to the existing west facing side / gable wall and to part of the rear wall of the main part of the house;
(xi) other internal renovations & refurbishments and site works to facilitate the development.

The development will consist of the following works to the two / three storey dwelling:
* Demolition of single storey sheds, one to side elevation in side passage and one to rear;
*Demolition of single storey double garage on boundary wall in rear garden, work to remaining boundary wall on laneway to include blocking up one garage door and upgrading of existing garage door,
* Construction of a two storey extension to the front and side elevation in side passageway with 2 no. roof lights;
* Construction of a new single storey extension to the rear with 2 no. linear roof lights to the rear;
* Construction of 2 no. new roof lights in existing two storey return roof to rear;
* Construction of 4 no. new roof lights in existing roof at attic level to rear;
* Front, side and rear elevation changes including enlarged window at first floor level in existing two storey return to rear;
* Refurbishment and internal amendments to the existing dwelling on all levels;
* All associated conservation and repair work, landscaping to front and rear gardens, drainage and site development works.

The development will consist of modifications to existing two storey house which will include; 
1. Change existing hipped side of roof to gable with a new roof light on each of the front and rear slopes.
2. Addition of attic access stairs ( and internal alterations) and dormer window to rear.

PROTECTED STRUCTURE: Development will consist of:
i) Internal and external alterations to the non-original extension to the rear of No. 40 Dawson Street (approved under Reg. Ref. 2954/98), comprising removal of existing doors and glazed rear elevation (facing Anne's Lane), removal of stairs and balconies at first and second floor levels, and removal of part openable glazed roof; and construction of new faux rear facade set back 5 metres from the boundary with Anne's Lane comprising timber framed glazed entrance doors at ground floor and timber glazed screen at first, second and third floor level above, creating an internal street garden with feature side facades, and street garden entrance, with void above to roof level; new facade treatment to boundary with Anne's Lane comprising an aluminium framed glazed wall at second and third floor, new signage, and security roller shutter door to extend to ground and first floor; new retractable aluminium framed glazed roof; new bar at ground floor level;
ii) Internal and external alterations to non-original extension to the rear of No. 39 Dawson Street, comprising extensions to internal balconies and creation of glazed screen balconies fronting Anne's Lane at first and second floor levels;
iii) Installation of a new folding timber framed glazed screen at the rear of the bar area of No. 39 and at the rear of the foyer area of No. 40, at ground floor level of the buildings to the front of the property, facing Dawson Street (Protected Structures); and 
iv) All ancillary works necessary to facilitate the development.
The development does not increase the gross floor area of the property.

The development will consist of: Demolition of 3 no. existing school (and school related) structures comprising prefab classrooms, a disused classroom block and a changing room block; 
Construction of a 2-storey sports hall accommodating double height play courts, fitness suite, changing rooms and ancillary facilities; 
Construction of 2 no. all-weather playing pitches comprising 1 no. championship sized floodlit playing pitch and I no. 5-a-side sized floodlit playing pitch with associated ball stop netting, boundary fencing and landscaping; 
Provision of car parking (24 spaces) and coach set-down (3 bays) along realigned internal access road to south of St. Pauls College with vehicular access from existing entrance to Sybil Hill Road; 
Cycle parking, boundary treatments and all associated site works and services.
A Natura Impact Statement (NIS) will be submitted to the planning authority with the application

PROTECTED STRUCTURE: A Treatment Plant and associated infrastructure to treat waste and wastewater for an estimated 4,000 Population Equivalent (PE) on a 0.08 Ha site. The facility will treat both hazardous and non hazardous waste and wastewater generated onsite during the normal operation of the hospital. The proposed development comprises:
a) 1 no. Hydrolysis tank, 5 sq.m, with a maximum height of 6 m;
b) A 78 sq.m Membrane Bioreactor Building with a maximum height of 6 m;
c) An Anaerobic Digestor, 37 sq.m with a maximum height of 6 m;
d) 1 no. Treatment Building, 180 sq.m, with a maximum height of 7 m and other works necessary to facilitate the proposed development.
An Environmental Impact Assessment Report and Appropriate Assessment Screening have been prepared in respect of the planning application. This application relates to a development which will require an EPA IED licence.
The site is accessed from the North Circular Road with existing protected structures within the Mater campus. No works to any of the protected structures within the subject site are proposed.

The development will consist of an 88 bed space hostel development comprising:
 1) the construction of a three storey extension to the rear of 38 Abbey Street Upper ( including above the first floor of the existing building facing onto  Abbey Cottages) and above and to the rear of 39 Abbey Street Upper 
2) The change of use of part of the ground floor and the first floor of 38 Abbey Street Upper from restaurant to hostel use
3) the change of use of the existing second, third and fourth floors of 38 Abbey Street Upper from residential to Hostel use;
4) the change of use of part of the ground and the first floor of 39 Abbey Street Upper from restaurant to hostel use and ;
5) all other works required to facilitate the proposed development including a new entrance and shop front on the ground floor and elevation treatment of the existing first floor of 39 Abbey Street Upper, new elevation treatment of the existing first floor of the building that fronts onto Abbey Cottages, and an enclosed plant room on the roof.

The development will consist of:
-Amalgamation of the 2 no. existing restaurant units at ground floor level measuring 85 sq.m (Unit 3) and 101 sq.m (Unit 4) to provide 1 no. single restaurant unit measuring 191 sq.m; 
-Provision of a new shopfront (eastern elevation); 
-Modifications to the southern and western elevations;
-Internal works including the demolition of attic space;
-And all associated works above and below ground.

The development will consist of:
i) Demolition of:
a) existing fire damaged/ derelict, 2-storey over basement public house at 105 & 107 Emmet Road (formerly The Horse and Jockey public house);
b) a two storey dwelling at 109 & 111 Emmet Road and 
c) a single storey motorcycle workshop at 99 Emmmet Road and
ii) The construction of a 2-3 and part 4 storey (penthouse level set back from main facades at 3rd floor level) residential/ commercial development over basement and lower ground floor level, in two separate blocks (Blocks A & B), with both buildings stepped at rear and comprising:
a) 5 no. 1 bedroom apartments, 9 no. 2 bedroom apartments and 5 no. 3 bedroom apartments (19 no. apartments in total), with balconies at lower ground floor, ground floor, first floor and second floor levels, winter gardens at ground floor level, and roof terraces at second and third floor levels;
b) 1 no. commercial/ office unit at ground floor level in block B;
c) bicycle store, bin store and individual storage facilities at basement level;
d) 18 no. car park spaces at basement and lower ground floor level, served by a new vehicular entrance/ fire tender access from Myra Close;
e) landscaped open space between blocks A & B at ground floor level;
f) associated site works and;
g) the relocation of a public combined overflow sewer from nos. 105, 107 & 109 Emmet Road to landscaped open space between proposed blocks A & B at nos. 99, 101, 103, 105, 107, 109 & 111 Emmet Road, Inchicore, Dublin 8.
This site is bounded by Emmet Road to the south, by Coffey's public house to the east, by Myra Close to the north, by Kilmainham Banks apartment development to the north and west and by Massey's funeral home to the west.

PROTECTED STRUCTURE: The development will consist of:
i) Change of use at lower ground floor from residential to office use, together with internal partitioned layout;
ii) Alterations at lower ground floor level to comprise removal of non-original double glazed door and glazed side panels on the rear elevation of the main building, to allow reinstatement of original window ope comprising sliding sash window, stone cill and brickwork to cill level; alterations to non-original glazed screen to the interior of the building, at the division of the main building with the rear return, allowing the reinstatement of an original internal ope; installation of new fire-rated lobby within the rear return;
iii) Alterations at first floor level to comprise removal of non-original double glazed doors and 'juliet balcony' on the rear elevation of the main building to allow re-instatement of original projecting bay window; and
iv) All ancillary works necessary to facilitate the development.
The development does not result in any change to the floor area or footprint of the building, nor any alterations to the front facade.

The development will consist of : 
a) demolition of existing boiler shed and single storey return at ground level (rear), demolition of one no. redundant chimney stack (side), alterations of existing entrance archway to existing front elevation, and modifications to side elevation to provide a new rear access; 
b) internal alterations to ground and first floor layout to facilitate new layout; 
c) a new two storey extension to the side and a single storey extension to rear, 
d) new windows and doors throughout, 
e) Roof lights, landscaping and all ancillary works that may be associated with the development.

Development at a site within the overall Grangegorman Strategic Development Zone (SDZ) of approx. 28.69 hectare at Grangegorman, Dublin 7. 
The development will consist of a new one to two storey building comprising energy centre and educational facility (approx. 1,868 sq.m) ranging in height from approx. 8.36 m (34.86 m OD) to approx. 14.08 m (41.45 m OD) including parapet and a flue (approx. 30M (56.5 M. OD) at the north elevation, other elements include: 
-plant and photo voltaic panels at roof level; 
-service access road, gated entrance and yard to the west of the building adjoining existing boundary wall (Note: Sections of the existing Grangegorman boundary walls are a Protected Structure);
-associated permanent and temporary boundary treatments;
-temporary landscaping to the south and north of the building;
-and all associated site development works (including drainage works, lighting and building signage)
All located at or in proximity to the western boundary of the SDZ lands to the south of the Phoenix Care Centre, west of the Top House and north of St. Brendan's Way.

Development consisting of:
i)Demolition of 2 no. two-storey existing structurally unsound terraced dwellings at Nos. 6 & 7 Walworth Road and construction of 2 no. replacement two-storey terraced dwellings similar in form, appearance and character to existing dwellings;
ii) Provision of private open space to rear of each dwelling;
iii) Demolition of existing garage to rear of No. 7 Walworth Road and 
iv) All associated site development works necessary to facilitate the development.

Amendments to Block D previously permitted under Reg.Ref. 2186/09 / An Bord Pleanala Ref. PL29S.234927. The development comprises of:
- Internal reconfiguration of Block D to provide for a revised layout of previously permitted 17 no. 1 bed units and 2 no. 2 bed units;
- Reduction of permitted crèche from 482.8 sq.m to 479.4 sq.m gross floor area;
- Revisions to all elevations (north, south, east and west) including provision of private terraces/ balconies to serve each unit;
- Increase in gross floor area of Block D from 2,166.8 sq.m to 2,199 sq.m.

RETENTION: Development consisting of: i) A single-storey kitchen extension and a garden shed at the rear of the house;
ii) An attic conversion with stair access, dormer window and two Velux windows in the rear roof of the house.
The works include all associated internal, site and drainage work.

PROTECTED STRUCTURE: Planning permission sought at the 1.29 hectares (3.44 acres) site for development consisting of amendments and additions to a previously permitted development Reg.Ref. 2710/14, 4296/15 and PL29S.244337 comprising:
a) The replacement of the permitted 3-storey dwelling no. 36 (type A1) with a new 3-storey, 3-bedroom house type B1;
b) The provision of 1 no. additional end-of-terrace 3-storey 3-bedroom type B1 dwelling unit;
c) Amendments to the rear boundary of permitted dwelling no. 35;
including all rooflights and related infrastructural works, car parking and landscaping.
The site is accessed by an existing gateway from Mount Tallant Avenue, including piers and railings on a plinth wall which is a Protected Structure. No works are proposed to the Protected Structure as part of this planning application.

PROTECTED STRUCTURE: Amendments to previously permitted development Reg.Ref. 2186/15 (An Bord Pleanála Ref.: PL29S.245164) as amended by Reg.Ref. 2825/17 on a site of c. 1.7 ha.
The application site includes a Protected Structure RPS Ref.No.: 3583.
The proposed amendments consist of the following:
- Alterations to proposed Blocks E, F, G (Reg.Ref. 2825/17) to increase the height of the Blocks from 4 no. storeys (13 m) to 5 no. storeys (16 m), the additional storey in Block F will be set back on the eastern elevation at 4th floor level (5 no. storey);
- The additional storeys on Blocks E, F and G will provide for 30 no. units (13 no. in Block E, 5 no. in Block F and 12 no. in Block G) and will comprise of 5 no. 1 beds, 18 no. 2 beds and 7 no. 3 beds.
- Replacement of 2 no. 3 bed units at ground floor level of Block G with a crèche c. 254 sq.m. An outdoor play area of c. 150 sq.m will also be provided in association with the crèche;
- Elevational amendments to Blocks E, F, G including private balconies/ terraces as a result of the additional storey;
- Reconfiguration of permitted basement to provide for 160 no. car parking spaces and 226 no. cycle spaces;
- Revisions to landscape masterplan layout to provide additional hard and soft landscaping;
- Minor alterations to roof plans to provide for flues and lift shafts at roof level and all necessary site works to facilitate the development.
The proposed amendments will result in an overall increase of 28 no. additional units, increasing the total number of units permitted under Reg. Ref.: 2186/15 (An Bord Pleanála Ref.: PL29S.245164) as amended by Reg.Ref.: 2825/17 from 172 no. to 200 no. units.

The development comprises: 
i) First floor extension with hipped roof, with 1 no. window to front south elevation; together with a lean-to roof above converted ground floor garage extension with 1 no. new window on front south elevation;
ii) Proposed ground floor flat roof rear extension with 1 no. roof light and replacement of lean-to roof on east elevation with flat roof and 1 no. rooflight;
iii) Refurbishment of existing rear north facing balcony with new rendered finish and glazed elements; with all associated site and ground works necessary to facilitate the development.

The development will consist of an 88 bed space hostel development comprising:
1) The construction of a three storey extension to the rear of 38 Abbey Street Upper (including above the first floor of the existing building facing onto Abbey Cottages) and above and to the rear of 39 Abbey Street Upper;
2) The change of use of part of the ground floor and the first floor of 38 Abbey Street Upper from restaurant to hostel use 
3) The change of use of the existing second, third and fourth floors of 38 Abbey Street Upper from residential to hostel use;
4) The change of use of part of the ground and the first floor of 39 Abbey Street Upper from restaurant to hostel use and;
5) all other works required to facilitate the proposed development including a new entrance and shop front on the ground floor and elevation treatment of the existing first floor of 39 Abbey Street Upper, new elevation treatment of the existing first floor of the building that fronts onto Abbey Cottages, and an enclosed plant room on the roof.

PROTECTED STRUCTURE: We Versus Ltd. (In Receivership), Abbono Ltd. (In Receivership) Beckton Properties Ltd. (In Receivership) & Candourity Ltd. (In Receivership) (each acting by the Joint Receivers Mark Reynolds & Glenn Cran), Savills, 33 Molesworth Street, Dublin 2. Intend to apply for Planning Permission. For Development at a site of 1.056 ha known as The Former Boland's Mill incorporating 33 & 34 Barrow Street together with & 35A Barrow Street & 35 Barrow Street (Car Park) at Ringsend Road and Barrow Street, Dublin 4, bounded to the north by Ringsend Road, to the south by adjacent office development ( Mason Hayes Curran ( " South Bank House") and the warehouse, to the east by Barrow Street and to the west by Grand Canal Dock.
The site accommodates 4 protected structures including; Block B referred to as 1 Ringsend Road (RPS 7377); Block D comprising No's 33 and 34 Barrow Street ( RPS 483, 484); two storey brick gables of warehouses to south of Boland's Mill ( the "factory" building ( (RPS 485).
The proposed development seeks amendments to previously permitted Building 1, Building 2, Building C and Building D permitted under DSDZ3796/14. The amendments consist of:
1. Revised footprint, cores and floor plates to Building 1 and Building 2 including internal goods lifts;
2. Revised fin detail, facades and elevational treatment to the Building 1 and Building 2 elevations;
3. Revised louvres to roof plant screening to Building 1 and Building 2 and at ground level from basements;
4. Revised basement footprints to Building 1 and Building 2 increasing the GFA by 255sq.m;
5. Omission of basement links to Buildings C and  D and relocation of Mason Hayes Curran basement connection from -2 level to -1 level;
6. Revised entrance to office space from Barrow Street at Buildings 1 and Buildings D including revised treatment between the two buildings and revised layout and elevations;
7. Partial change of use (88sq.m GFA) on the permitted café to office use to Barrow Street;
8. Increase in bicycle parking by 10 no. spaces providing a total of 359 bicycle spaces
9. All ancillary and associated site development and infrastructural works minor elevational changes as a result of the other amendments
The proposed amendments result in an increase in GFA of Building 1 of 788sq.m to a total GFA of 14,064 sq.m. The proposed amendments result in an increase in GFA of Building 2 of 793sq.m to a total GFA of 12,533 sq.m. The proposed amendments result in an increase in GFA of Building 1 of Basement levels -1, -2 and -3 by 255sq.m to 13,128sq.m total.
The application relates to a proposed development within a Strategic Development Zone Planning Scheme Area.

The development will consist of internal and external alterations to the existing three storey over basement building with part-three, part-four storey rear return (former presbytery accommodation associated with the Mary Immaculate Refuge of Sinners Church) comprising:
(i) Refurbishment of front (west) elevation consisting of installation of new windows in existing opes, new aluminium clad facade, and new front entrance door at upper ground floor level and removal of existing roller shutter door and window opes at lower ground floor level and replacement with new single external door to new sunken courtyard at lower ground floor level;
(ii) Refurbishment of rear (east) elevation consisting of alteration of opes and installation of new windows to four storey rear return;
(iii) Refurbishment of side (south) elevation consisting of the demolition of attached porch (4 sq.m) at upper ground floor level, alteration of window opes at upper ground, first and second floor levels to raise the window cill height to 1.6 m above finished floor level, and installation of new windows, and part new aluminium clad and part coloured render facade; 
(iv) Refurbishment of side (north) elevation consisting of blocking up of 2 no. windows at lower ground floor level and alteration of new windows, and new coloured render facade;
(v) Construction of a single storey extension (11 sq.m) within the new sunken courtyard level at the lower ground floor level;
(vi) Construction of a new third floor level (81.2 sq.m), with flat roof, set back 3.9 m from the front elevation of the building. The building setback on the front (west) side will accommodate a roof terrace with solid aluminium clad balustrade;
(vii) Alterations within the front building setback to create sunken courtyard at lower ground floor level with steps to street level above; pedestrian access from street level to new entrance door at upper ground level, to include steps and external Part M compliant platform lift; bin store and new boundary treatment to Rathmines Road Lower, to comprise railing and hedgerow. 
Permission is also sought for change of use of the property from presbytery accommodation associated with the Mary Immaculate Refuge of Sinners Church (which consists of 5 no. bedrooms, living rooms, reception rooms, kitchens, office and ancillary stores) to serviced short-stay tourist accommodation comprising a total of 8 no. bedroom suites (comprising 2 no. studio guest suites, 1 no. one-bedroom guest suite, 5 no. two-bedroom guest suites), together with a reception, guest services and coffee dock at upper ground floor/ entrance level.
All ancillary works necessary to facilitate the development.

Modifications to the Nursing Home and Independent Living Units permitted by An Bord Pleanála under Ref. PL29S.241890 (Dublin City Council 2882/12). The modifications will consist of:
- Reconfiguration of the car park to provide 43 additional car parking spaces (total of 102 no. spaces);
- Construction of 6 no. bin stores;
- Construction of sub-station.

Planning permission is sought to:
a) Demolish existing extension to rear;
b) Construct single storey extension;
c) Construct first floor extension above existing attached garage to side;
d) Construct porch to front;
e) Together with all associated site works.

Planning permission is sought for an extension to the Ashling Hotel comprising the following:
1.  Construction of a 10-storey aparthotel on the corner of Parkgate Street and Temple Street West within thirty one executive self contained suites; (a) The ground floor will have a reception/ entrance lobby, lift and stair core, plant room, and separate access from Ashling Hotel; 
(b) First floor will contain one no. two bed executive suite and two no. one bed executive suites with balconies to the south ; 
(c) Floors 2-7 will each contain four no. one bed executive suites with balconies on southern facing suites; 
(d) Floor eight which is set back on all sides, will have two no. executive suites with open terraces to the south and north; 
(e) Floor nine which is set back on all sides, will have two no. one bed executive suites: 
(f) there will be a screened plant area at roof level. 
2. The demolition of the following buildings to facilitate the proposed development:
(i) Three storey residential building at 6 Parkgate Street Dublin 8; 
(ii) the three storey mixed use building at 4-5 Parkgate Street Dublin 8, 
(iii) the four storey residential terraced building at 12 Temple Street West, Dublin 7, 
(iv) the two storey residential terraced building at 11 Temple Street West, Dublin 7, (all of these buildings are vacant and are in a semi derelict condition), 
3. Twenty five bicycle stands, signage to the front and sides of the aparthotel, and all site works associated and necessary for the proposed development.

The development will consist of:
- Renovation and change of use of existing 2-storey office building to residential use to accommodate 6 no. apartments, including demolition of boiler room to side of building; 
- Extension to existing building by construction of a new 2nd floor level to accommodate 3 no. apartments; 
- The total of 9 no. apartments to comprise 5 no. 1-bedroom units, 3 no. 2-bedroom units and 1 no. 3-bedroom unit; 
- Provision of balconies at first and second floor levels, plant and storage areas at roof level, landscaped open space, 9 no. car parking spaces, bicycle parking, removal of boundary wall, new boundary treatments and all associated site works and services.

Planning permission for development on a site of c.0.26 ha, located at the Fitzwilliam Hotel, Nos. 128-134 St. Stephen's Green West, Dublin 2. The development will consist of the remodelling and extension of the existing hotel at 4th - 7th floor levels fronting onto St. Stephen's Green (c.827m2) and will include: 
(i) the framing of the existing bedroom terraces at 4th floor level; 
(ii) the reorganisation and extension of the existing bedrooms and circulation spaces at 5th floor level, resulting in 2 no. additional bedrooms, with new bedroom terraces at this level fronting onto St. Stephen's Green; 
(iii) 8 no. additional bedrooms with terraces fronting onto St. Stephen's Green, a new terrace to the existing presidential suite and revised circulation and servicing arrangements at 6th floor level; and (iv) 6 no. additional bedrooms with revised circulation and servicing arrangements at 7th floor level. 
The development will include an amendment to Planning Reg. Ref. 2636/11/x1 comprising the omission of the freestanding lift shaft permitted as part of an extension to the rear of the main hotel block at 5th - 8th floor levels and its replacement with an internal lift shaft within the permitted building envelope at 7th and 8th floor levels. The proposed and permitted extensions will link at the 6th and 7th floor levels, resulting in the enlargement of 1 no. permitted bedroom at the 7th floor level and an overall floorspace reduction of the permitted extension of 109m2. 
The development will also include the relocation of existing water tanks at 6th floor level to the existing basement level; piped infrastructure and ducting and all associated site development works.

The development will consist of the provision of a new residential development consisting of:
a) erection of 12 no. apartment units comprising 1 no. one-bedroom and 11 no. two-bedroom units with private terrace/ balcony areas in 2 no. four-storey apartment buildings fronting Botanic Road;
b) erection of 19 no. houses comprising 16 no. four-bedroom and 3 no. three-bedroom units with private rear gardens (17 no. houses will also contain a terrace area to the front elevations);
c) 47 no. car parking spaces, bicycle parking and refuse area at basement level (with access to and from Botanic Road);
d) central courtyard area;
e) paving and landscaping works to include tree planting and provision of green areas;
f) restoration and upgrade works to the site boundaries;
g) re-orientation of existing footpath along Botanic Road;
h) installation of street lighting;
i) surface water and foul drainage;
j) demolition of 'The Addison Lodge', a two-storey public house and 'Glasnevin Lodge', a two-storey house with attic floor level and all existing out-buildings, and
k) all other site works necessary to facilitate the development.

PROTECTED STRUCTURE: Development at a 0.1350 hectare site. The site includes the former Tripod bar and venue and consists of the northern element of the platform building of the former Harcourt Street Railway Station. A part of a protected structure is situated within the application site (RPS Ref.3514: former station roof and facade).
The development consists of the following:
i) Change of use of three areas within the vaulted foundation spaces at ground level to retail/ restaurant use (598 sq.m Gross Floor Area);
ii) Change of use of the front of the building (to Hatch Street) at ground level and the first floor/ podium level and second floor/ mezzanine level of the northern element of the platform building (existing second floor/mezzanine floor to be removed and new floor provided) to office use (1,747 sq.m resultant Gross Floor Area in office use); 
iii) Removal of non-original features and interventions in accordance with good conservation practice;
iv) Provision of glazed entrance to north elevation, replacement roof lights incorporated into a repaired and replaced roof as appropriate, glazed arched facades to vaulted foundations on east and west elevations, similar to works previously carried out at the southern element of the platform building;
v) Upgrade of the existing service yard to provide a new public realm space, including the removal of the existing boundary railing and gates, and provision of new paving, steps landscaping and 22 bicycle parking spaces;
vi) All conservation repair, replacement and refurbishment works in accordance with the submitted documentation;
vii) All ancillary and associated site development works.

The development will consist of (i) the demolition of: two storey over-basement dwelling at no. 120 Richmond Road; and two storey dwelling at no. 118 Richmond Road; 
(ii) Construction of 18 no. apartments in 2 no. four storey blocks over ground floor / under croft level car-parking (five storey in total), comprising: (Block A) fronting onto Richmond Road, consisting of 11 no. apartment units (3 no. one bed; 6 no. two bed; 2 no. one bed penthouse units); and (Block B) to the rear of the site comprising of 7 no. apartment units (6 no. two bed units; 1 no. three bed penthouse unit); 
(iii) Other works as part of the development include: all apartments with private terraces / balconies; communal landscaped open space area at the centre of the site at first floor level; under croft car and bicycle parking at ground level accessible from Richmond Road; new and upgrade to existing boundary walls and vehicular entrance along Richmond Road to include pedestrian entrance. The development will also include: boundary treatments; landscaping; SuDS drainage; and all associated site works necessary to facilitate the development.

The proposed development will consist of the: 
i) demolition of the existing buildings,
ii) construction of a new fuel forecourt with 3 forecourt fuel pumps and forecourt canopy,
iii) control/ store and offset fill buildings;
iv) air and water services area;
v) underground fuel storage tanks,
vi) revised entrance and exit arrangements;
vii) erection of company signage;
viii) boundary wall cladding;
ix) site lighting, and 
x) all associated site, drainage, landscaping and development works.

Permission for a mixed-use development at a site bounded and accessed by both Walkinstown Road and Balfe Road, comprising of Balfe Road Industrial Estate (2-4 Balfe Road), Walkinstown Road Surface Car Park and lands and industrial building (5 Walkinstown Road) to the rear of houses on Walkinstown Road and Thomas Moore Road, Walkinstown, Dublin 12.
The development will consist of:
1. The demolition of all existing buildings on site;
2. The construction of a mixed-use commercial and residential development in 4 no. blocks accommodating 3 no. commercial units and 58 no. residential units comprising 14 no. 1 bed units (Apartments), 24 no. 2 bed units (Apartments) and 20 no. 3 bed units (12 no. Townhouses and 8 no. Apartments);
