-the refurbishment and internal re-configuration of existing ground floor office accommodation (380 sq.m approximately); 
-minor works at lower ground and basement levels comprising the removal of an existing lift car; 
-the provision of a ground floor office extension (124 sq.m approximately); 
-upgrade and refurbishment works at roof level, and 
-all ancillary development including revisions to access arrangements, minor elevational changes, landscaping and site development works.

The development consists of the following:
(i) The provision of a nine storey including two set back storeys (over basement) commercial development with 18,464 sq.m. gross floor area of office space;
(ii) The provision of a new pedestrian link from Harcourt Road through to the existing plaza area west of One Park Place, providing for access through to Hatch Street Upper from Harcourt Road;
(iii) The provision of two retail/restaurant/cafe units at ground floor to Harcourt Road and Adelaide Road with a GFA of 640 sq.m.  (including mezzanine level);
(iv) The provision of a single storey basement level of 2,648 sq.m. GFA which would link to the existing basement servicing One, Two and Three Park Place. Vehicular access to the basement is proposed via the existing ramp to Hatch Street Upper at Two and Three Park Place;
(v) The provision of 48 no. car parking spaces and 193 bicycle parking spaces at the proposed basement level with associated facilities;
(vi) The proposed development involves the demolition of the former Telephone Exchange building and vaulted foundations 10 and 11 adjacent to the former Harcourt Railway Station buildings;
(vii) Public realm upgrades to Harcourt Road and Adelaide Road linking through to the plaza  area west of One Park Place;
(viii) All ancillary and associated site development, demolition works, site clearance, infrastructural works, provision of plant at basement and roof levels including photovoltaic panels.
(ix) The overall development consists of a total 21,906 sq.m. GFA.

